import React, {Component} from 'react'
import '../App.css'
export class Basic extends Component{
    render(){
        return(
            <div>
                <h2>
                Welcome Doctor_Name<br></br>
                {/* <hr></hr> */}
                Doc ID:
                </h2>
            </div>
        )
    }
}

export class Alerts extends Component{
    render(){
        return(
        <div>
            <div className="title">
                Alerts
            </div>
            <div className="patients">
                Sumanth
            </div>
            <div className="patients">
                Saketh
            </div>
            <div className="patients">
                Kumar
            </div>
        </div>
        )
    }
}
function expand(){
    return(
        document.querySelector("patients").style.display = "none"
    )
}
export class Patients extends Component{
    render(){
        return(
        <div>
            <div className="patients">
                Sumanth
            </div>
            <div className="title">
                Registered Patients
                <button onClick={expand}>expand</button>
            </div>

{/*             <div className="patients">
                Saketh
            </div>
            <div className="patients">
                Kumar
            </div> */}
        </div>
        )
    }
}
